import PropTypes from 'prop-types'
import React, { Component } from 'react'

export default class Task extends Component {
  render() {
    return (
      <div className='container col-5 text-center rounded position-absolute top-50 start-50 translate-middle bg-danger'>
        <h3 className=''>Create a new Tasks</h3>
        <form>
          <label for="exampleInputEmail1" class="form-label">Email address</label>
          <input type="email" class="form-control col " id="exampleInputEmail1" aria-describedby="emailHelp" />
        </form>
      </div>
    )
  }
}
